import React from 'react';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';
import './App.css';

const Home: React.FC = () => <div>ホームページです</div>

function App() {
  return (
    <Router>
      <div>
        <nav>
          <Link to="/">ホーム</Link>
        </nav>

        <Route path="/" Component={Home} />
      </div>
    </Router>
  );
}

